import React from "react";
import Button from "./UI/Button";
import ModalWindow from "./UI/ModalWindow";
import CreateInputForm from "./CreateInputForm";
import FilterUsers from "./FilterUsers";
import CreateTable from "./CreateTable";

const CreateTableForm = ({
  setModal,
  modal,
  createUser,
  userList,
  filter,
  setFilter,
  searchAndSort,
  removeUser,
  requestSort,
}) => {
  return (
    <div>
      <Button onClick={() => setModal(true)}>Create new user</Button>
      <ModalWindow visible={modal} setVisible={setModal}>
        <CreateInputForm createUser={createUser} userList={userList} />
      </ModalWindow>

      <FilterUsers filter={filter} setFilter={setFilter} />
      <CreateTable
        userList={searchAndSort}
        remove={removeUser}
        requestSort={requestSort}
      />
    </div>
  );
};

export default CreateTableForm;
